  false,\n\t\"url\": null,\n\t\"notes\": \"Twelve quadrats were sampled along 2 consecutively-placed,
  25m transect lines as part of Rapid Ecological Assessments conducted at 3 sites
  at Laysan Island in the Northwestern Hawaiian Islands in September and October,
  2002 from the NOAA vessel Townsend Cromwell (TC02-07). Raw survey data included
  genus presence and relative abundance, and voucher specimens. Detailed taxonomic
  analyses of voucher specimens are presented.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
